headers = ['municipality','year_of_assessment','address','borough','cadastre_and_number_lot','serial_number','predominant_use','neighborhood_unit_number','file_no','owner_name','owner_status_for_education_tax','owner_address','owner_started_on_the_role','lot_front_measure','lot_area','building_no_of_floors','building_year_of_construction','building_area_of_floors','building_type','building_physical_link','building_no_of_units','building_no_of_non_residential_premises','building_no_of_room_rental','reference_date_of_contract','land_value','building_value','total_value','value_of_property_at_previous_role','taxable_value_of_building','non_taxable_value_of_building']

CSV($stdout, headers: headers, write_headers: true) do |out|
  curls.each do |curl|
    url = curl + " -s"
    command = "#{url}"
    response = `#{command}`
    json = JSON.parse(response)
    htmlBlob = JSON.parse(json['response'])['HTML']
    html = Nokogiri::HTML(htmlBlob)
    identificationOfUnit = html.xpath('/html/body/table[1]')
    owner = html.xpath('/html/body/table[2]')
    characteristicsOfUnit = html.xpath('/html/body/table[3]')
    valuations = html.xpath('/html/body/table[4]')
    taxDistributions = html.xpath('/html/body/table[5]')

    out << CSV::Row.new(headers, []).tap do |row|
      row['municipality'] = html.xpath('/html/body/p[@class="SIGim_rol_title2"]/b').text()
      row['year_of_assessment'] = html.xpath('/html/body/p[@class="SIGim_rol_title3"]/b').text()
      row['address'] = identificationOfUnit.xpath('tr[1]/td[2]').text()
      row['borough'] = identificationOfUnit.xpath('tr[2]/td[2]').text()
      row['cadastre_and_number_lot'] = identificationOfUnit.xpath('tr[3]/td[2]').text()
      row['serial_number'] = identificationOfUnit.xpath('tr[4]/td[2]').text()
      row['predominant_use'] = identificationOfUnit.xpath('tr[5]/td[2]').text()
      row['neighborhood_unit_number'] = identificationOfUnit.xpath('tr[6]/td[2]').text()
      row['file_no'] = identificationOfUnit.xpath('tr[7]/td[2]').text()
      row['owner_name'] = owner.xpath('tr[1]/td[2]').text()
      row['owner_status_for_education_tax'] = owner.xpath('tr[2]/td[2]').text()
      row['owner_address'] = owner.xpath('tr[3]/td[2]').text()
      row['owner_started_on_the_role'] = owner.xpath('tr[4]/td[2]').text()
      row['lot_front_measure'] = characteristicsOfUnit.xpath('tr[1]/td[1]/table/tr[2]/td[2]').text()
      row['lot_area'] = characteristicsOfUnit.xpath('tr[1]/td[1]/table/tr[3]/td[2]').text()
      row['building_no_of_floors'] = characteristicsOfUnit.xpath('tr[1]/td[2]/table/tr[2]/td[2]').text()
      row['building_year_of_construction'] = characteristicsOfUnit.xpath('tr[1]/td[2]/table/tr[3]/td[2]').text()
      row['building_area_of_floors'] = characteristicsOfUnit.xpath('tr[1]/td[2]/table/tr[4]/td[2]').text()
      row['building_type'] = characteristicsOfUnit.xpath('tr[1]/td[2]/table/tr[5]/td[2]').text()
      row['building_physical_link'] = characteristicsOfUnit.xpath('tr[1]/td[2]/table/tr[6]/td[2]').text()
      row['building_no_of_units'] = characteristicsOfUnit.xpath('tr[1]/td[2]/table/tr[7]/td[2]').text()
      row['building_no_of_non_residential_premises'] = characteristicsOfUnit.xpath('tr[1]/td[2]/table/tr[8]/td[2]').text()
      row['building_no_of_room_rental'] = characteristicsOfUnit.xpath('tr[1]/td[2]/table/tr[9]/td[2]').text()
      row['reference_date_of_contract'] = valuations.xpath('tr[1]/td[2]').text()
      row['land_value'] = valuations.xpath('tr[2]/td[2]').text()
      row['building_value'] = valuations.xpath('tr[3]/td[2]').text()
      row['total_value'] = valuations.xpath('tr[4]/td[2]').text()
      row['value_of_property_at_previous_role'] = valuations.xpath('tr[6]/td[2]').text()
      row['taxable_value_of_building'] = taxDistributions.xpath('tr[3]/td[2]').text()
      row['non_taxable_value_of_building'] = taxDistributions.xpath('tr[3]/td[4]').text()
    end
  end
end
